import React from 'react'
import { Link, NavLink } from 'react-router-dom';
import '../components'

function NavigationBar() {
  return (
<nav>
      <ul>
        <li class="nav-item">
            <Link class="nav-link" to="/profile">Пользователи</Link>
        </li>

        <li class="nav-item">
            <Link class="nav-link" to="/schedule">Доступ к инфопанелям</Link>
        </li>

      </ul>
</nav>
  );
}



export default NavigationBar;
